import styles from './styles.module.scss';
import TitleComponent from '../../atoms/title';

export default function ShowReelComponent() {
  return (
    <section className={`${styles.showReel} u-container`}>
      <TitleComponent Tag="h2" variantClass="u-titlePrimary" variantClass="">SHOWREEL</TitleComponent>
    </section>
  )
}
